import './CSS/Outer.css'
import Navbars from './js/Navbars'
import {Link} from 'react-router-dom'


class Outer extends React.Component{
    render() {
        return (
            <div>

            <div className='titleLine'>
                <Link to = ''>
                <span className='mainTitle'> facebook</span>
                </Link>
            </div>
                <br />
                    <Navbars></Navbars>
            </div>
        )
    }
};

export default Outer;
